import React from 'react';
import { Route, Switch } from 'react-router-dom';
import SearchProfile from './pages/SearchProfile';

function App() {
  return (

    <Switch>
      <Route exact path="/" component={SearchProfile} />
      {/* <Route exact path="/profile" component={ Profile }/> */}
    </Switch>
  );
}

export default App;
